import React from "react";

function MiddleContent() {
  return (
    <div
      style={{
        backgroundColor: "red",
        display: "flex",
        justifyContent: "center",
      }}
    >
      <div>
        <h1 className="display-1 text-white font-weight-bold">
          Build your own ecommerce website in 3 easy steps
        </h1>
      </div>
    </div>
  );
}

export default MiddleContent;
